import Layout from '../common/Layout';

function Department() {
	const path = process.env.PUBLIC_URL;
	return (
		<Layout name={'Department'}>
			<div className='process'>
				<h2>Process</h2>
				<p>
					Out working method practices a simultaneous exploration of traditional
					handicraft and cutting edge digital technology – a complementary
					relationship that drives our creative process.
				</p>
			</div>
			<div className='team'>
				<h2>Out team</h2>
			</div>
		</Layout>
	);
}

export default Department;
